import { Card } from "../../card"

function showCard(item) {
    return <Card key={item.id} name={item} />
}
function displayAllRow(row,index) {
    return (
        <div key={this.index} className="row flex">
            {row.map(showCard)}
        </div>
    )
}
export { displayAllRow }
